4628484b0953"},{"version":"CommandV1","origId":121836,"guid":"193c0628-85a8-47dd-a80b-dba72674498e","subtype":"command","commandType":"auto","position":4.25,"command":"%md\n\n<img src =\"https://cloud.githubusercontent.com/assets/19589133/15626572/a489c5e8-251b-11e6-95a9-8839b41ec6a4.png\" width=\"800\" >\n\n####Change Detection\nIde and Kashima (2004) compare the current activity vector with the past average vector (profile vector) by computing the change score \\\\(s_t\\\\) for time instant, \\\\(t\\\\) as\n\n$$s_{t} = 1 - \\tilde{\\mathbf{u}}(t-1) \\cdot \\mathbf{u}(t) $$\n\nThe change scores of the nodes, \\\\(s^i_t\\\\) at time \\\\(t\\\\) is\n\n\n$$s^i_{t} = \\left |  \\tilde{\\mathbf{u}}(t-1) - \\mathbf{u}(t) \\right | $$\n","commandVersion":0,"state":"finished","results":null,"errorSummary":null,"error":null,"startTime":0.0,"submitTime":1.464839748813E12,"finishTime":0.0,"collapsed":false,"bindings":{},"inputWidgets":{},"displayType":"table","width":"auto","height":"auto","xColumns":null,"yColumns":null,"pivotColumns":null,"pivotAggregation":null,"customPlotOptions":{},"commentThread":[],"commentsVisible":false,"parentHierarchy":[],"diffInserts":[],"diffDeletes":[],"globalVars":{},"latestUser":"shakira.suwan@pg.canterbury.ac.nz","commandTitle":"","showCommandTitle":false,"hideCommandCode":false,"hideCommandResult":false,"iPythonMetadata":null,"nuid":"8e261fb6-5509-424f-8b33-c8b0ff667693"},{"version":"CommandV1","origId":121837,"guid":"412977b9-4eda-4779-927a-6c186aa5d12c","subtype":"command","commandType":"auto","position":4.5,"command":"%md \n\n<img src =\"https://cloud.githubusercontent.com/assets/19589133/15702090/1676446a-2832-11e6-80bf-a709a6247e3e.png\" width=\"1000\">\n\n\n","commandVersion":0,"state":"finished","results":null,"errorSummary":null,"error":null,"startTime":0.0,"submitTime":1.464839748858E12,"finishTime":0.0,"collapsed":false,"bindings":{},"inputWidgets":{},"displayType":"table","width":"auto","height":"auto","xColumns":null,"yColumns":n 4-7175-46a7-b57e-eeccf199e2d0"},{"version":"CommandV1","origId":121842,"guid":"ea486f5b-74eb-4e88-8875-c5dcc122b4dd","subtype":"command","commandType":"auto","position":12.125,"command":"def powerlawRnd(n:Int,xmin:Double, alpha:Double ):DenseVector[Double]={\n \n  val u=Range(0,n).map(v=>{\n     var r= new scala.util.Random\n    r.nextDouble()\n  }).toArray\n  \n  val plx=u.map(a=>xmin*pow((1-a),(-1/alpha-1)))\n  new DenseVector(plx)\n}\n","commandVersion":0,"state":"finished","results":{"type":"html","data":"<div class=\"ansiout\">powerlawRnd: (n: Int, xmin: Double, alpha: Double)breeze.linalg.DenseVector[Double]\n</div>","arguments":{},"addedWidgets":{},"removedWidgets":[]},"errorSummary":"The spark context has been stopped or the cluster has been terminated. Please restart the cluster or attach this notebook to a different cluster.","error":null,"startTime":1.464839964878E12,"submitTime":1.464839749161E12,"finishTime":1.46483996702E12,"collapsed":false,"bindings":{},"inputWidgets":{},"displayType":"table","width":"auto","height":"auto","xColumns":null,"yColumns":null,"pivotColumns":null,"pivotAggregation":null,"customPlotOptions":{},"commentThread":[],"commentsVisible":false,"parentHierarchy":[],"diffInserts":[],"diffDeletes":[],"globalVars":{},"latestUser":"shakira.suwan@pg.canterbury.ac.nz","commandTitle":"","showCommandTitle":false,"hideCommandCode":false,"hideCommandResult":false,"iPythonMetadata":null,"nuid":"d135b4ca-8eba-48fe-ab16-d767d9985f55"},{"version":"CommandV1","origId":123472,"guid":"3bc19fd4-840a-4fe7-9b48-80fc61cc405a","subtype":"command","commandType":"auto","position":12.3125,"command":"%md\n#### DCSBM Graphs\n* This function returns an \\\\(n_1 \\times n_2\\\\) degree corrected stochastic blockmodel graph","commandVersion":0,"state":"finished","results":null,"errorSummary":null,"error":null,"startTime":0.0,"submitTime":1.464839749179E12,"finishTime":0.0,"collapsed":false,"bindings":{},"inputWidgets":{},"displayType":"table","width":"auto","height":"auto","xColumns":null,"yColumns":null,"pivotColumns":null,"pivotAggregation":null,"customPlotOptions":{},"commentThread":[],"commentsVisible":false,"parentHierarchy":[],"diffInserts":[],"diffDeletes":[],"globalVars":{},"latestUser":"shakira.suwan@pg.canterbury.ac.nz","commandTitle":"","showCommandTitle":false,"hideCommandCode":false,"hideCommandResult":false,"iPythonMetadata":null,"nuid":"7b40e67c-58d6-45b9-8df7-583116af0cf0"},{"version":"CommandV1","origId":121843,"guid":"98e15189-9a16-4f0d-9567-6d6a3a15b92b","subtype":"command","commandType":"auto","position":12.5,"command":"def constructGraph(K:Int,p:DenseVector[Double], r:Double, theta1:DenseVector[Double],theta2:DenseVector[Double],lambda:Double,rho:DenseVector[Double],N1:Int,N2:Int):DenseMatrix[Double]={ \n\nvar n1_block:DenseVector[Double]= rho :* N1.toDouble\nn1_block = floor(n1_block)\nvar n1_ind = DenseMatrix.zeros[Double](K,2)\nval tmp = accumulate(n1_block)\nn1_ind(::,1) := tmp -1.toDouble\nn1_ind(0,0) = 0;\nn1_ind(1 to -1,0) := tmp(0 to -1-1) \n\n\nvar n2_block:DenseVector[Double]= rho :* N2.toDouble\nn2_block = floor(n2_block)\nvar n2_ind = DenseMatrix.zeros[Double](K,2)\nval tmp2 = accumulate(n2_block)\nn2_ind(::,1) := tmp2 - 1.toDouble\nn2_ind(0,0) = 0;\nn2_ind(1 to -1,0) := tmp2(0 to -1-1) \n \nvar temp1 = DenseMatrix.fill(K,K){n1_block(1)}\nvar temp2 = DenseMatrix.fill(K,K){n2_block(1)}\nvar expectedNum = temp1 :* temp2\n  \n\nvar p2:DenseVector[Double]=null\nif(p.length==1){ \n  var p1=p(0)\n  p2= DenseVector.fill(K){p1}\n}else{\n  p2 = p\n}\n  \nvar p1 = DenseVector.rangeD(1,K+1,1):* p2//clear structure (p1>p2) \nvar B = (lambda*DenseMatrix.eye[Double](K):* diag(p1)) :* expectedNum :+ ((1-lambda) * DenseMatrix.fill(K,K)(r) :*expectedNum) \n  \n  // generate node probabilities\n  \nvar Z1 = DenseMatrix.zeros[Double](N1,K)\nvar Z2 = DenseMatrix.zeros[Double](N2,K)\nvar blockDeg1 = DenseVector.zeros[Double](K)\nvar blockDeg2 = DenseVector.zeros[Double](K)\nvar rowDeg = DenseVector.zeros[Double](N1)\nvar colDeg = DenseVector.zeros[Double](N2)\n  \nval n1Ind = n1_ind.mapValues(_.toInt)\nval n2Ind = n2_ind.mapValues(_.toInt)\nfor(k <- 0 to K-1){\n    blockDeg1(k) =  sum(theta1.slice(n1Ind(k,0),n1Ind(k,1)))\n    blockDeg2(k) =  sum(theta2.slice(n2Ind(k,0),n2Ind(k,1)))\n    \n    rowDeg.slice(n1Ind(k,0),n1Ind(k,1)) := theta1.slice(n1Ind(k,0),n1Ind(k,1)) :/ blockDeg1(k)\n    colDeg.slice(n2Ind(k,0),n1Ind(k,1)) := theta2.slice(n2Ind(k,0),n2Ind(k,1)) :/ blockDeg2(k)\n    Z1(n1Ind(k,0) to n1Ind(k,1), k) := 1.0;\n    Z2(n2Ind(k,0) to n2Ind(k,1), k) := 1.0;\n}\n    \nvar nodeProb = diag(rowDeg) * Z1 * B * Z2.t * diag(colDeg)\n  \n  // create graph realizations\nvar W = DenseMatrix.zeros[Double](N1,N2)\nfor(i<-0 to N1-1){\n  for(j<- i+1 to N2-1){\n    var poi= Poisson(nodeProb(i,j))\n     W(i ,j) = poi.draw\n  }\n}\nvar A = W\nfor(i<-0 to N1-1){\n  for(j<- i+1 to N2-1){\n    if(W(i,j)!=0.0)\n     A(i ,j) = 1.0\n  }\n}\n  var A1 = upperTriangular(A) + upperTriangular(A).t\n  A1\n  \n}","commandVersion":0,"state":"finished","results":{"type":"html","data":"<div class=\"ansiout\">constructGraph: (K: Int, p: breeze.linalg.DenseVector[Double], r: Double, theta1: breeze.linalg.DenseVector[Double], theta2: breeze.linalg.DenseVector[Double], lambda: Double, rho: breeze.linalg.DenseVector[Double], N1: Int, N2: Int)breeze.linalg.DenseMatrix[Double]\n</div>","arguments":{},"addedWidgets":{},"removedWidgets":[]},"errorSummary":"The spark context has been stopped or the cluster has been terminated. Please restart the cluster or attach this notebook to a different cluster.","error":null,"startTime":1.464839967023E12,"submitTime":1.464839749215E12,"finishTime":1.46483997041E12,"collapsed":false,"bindings":{},"inputWidgets":{},"displayType":"table","width":"auto","height":"auto","xColumns":null,"yColumns":null,"pivotColumns":null,"pivotAggregation":null,"customPlotOptions":{},"commentThread":[],"commentsVisible":false,"parentHierarchy":[],"diffInserts":[],"diffDeletes":[],"globalVars":{},"latestUser":"shakira.suwan@pg.canterbury.ac.nz","commandTitle":"","showCommandTitle":false,"hideCommandCode":false,"hideCommandResult":false,"iPythonMetadata":null,"nuid":"32465c3f-8a3b-4d12-b01b-c59254ab41c1"},{"version":"CommandV1","origId":123473,"guid":"46c519e1-bf9b-4605-a38d-1648a68d0b06","subtype":"command","commandType":"auto","position":12.75,"command":"%md \n#### Change Scenarios \n* This function returns an \\\\(n_1 \\times n_2\\\\) changed dcsbm graph.","commandVersion":0,"state":"finished","results":null,"errorSummary":null,"error":null,"startTime":0.0,"submitTime":1.464839749244E12,"finishTime":0.0,"collapsed":false,"bindings":{},"inputWidgets":{},"displayType":"table","width":"auto","height":"auto","xColumns":null,"yColumns":null,"pivotColumns":null,"pivotAggregation":null,"customPlotOptions":{},"commentThread":[],"commentsVisible":false,"parentHierarchy":[],"diffInserts":[],"diffDeletes":[],"globalVars":{},"latestUser":"shakira.suwan@pg.canterbury.ac.nz","commandTitle":"","showCommandTitle":false,"hideCommandCode":false,"hideCommandResult":false,"iPythonMetadata":null,"nuid":"e9fadef1-e131-421c-a0dc-c1221f3229b6"},{"version":"CommandV1","origId":121844,"guid":"b4e663fd-2a1e-4f85-9709-0e064c60f765","subtype":"command","commandType":"auto","position":13.0,"command":"// create an anomaly graph, form, split, shift\ncase class graphAnomalyClass(W:DenseMatrix[Double],A1:DenseVector[Double], A2:DenseVector[Double])\ndef createA_anomaly(K:Int,p:Double, r:Double, theta1:DenseVector[Double],theta2:DenseVector[Double],lambda:Double,rho:DenseVector[Double],changeType:String, graphType:String):graphAnomalyClass={ \n  \n  var N1:Int = theta1.length\n  var N2:Int = theta2.length\n  val s1 = rho(0)*N1.toDouble\n  val s2 = rho(1)*N2.toDouble\n  var s1_temp = DenseVector.fill(K){s1}\n  var s2_temp = DenseVector.fill(K){s2}\n  val s1_cumsum = accumulate(s1_temp)\n  var s2_cumsum = accumulate(s2_temp)\n  val constD = DenseVector{0.0}\n  val constI = DenseVector{0}\n  var W_poi:DenseMatrix[Double]=null\n  var anomalies1:DenseVector[Double]=null\n  var anomalies2:DenseVector[Double]=null\n changeType match{\n    case \"form\"  =>  \n       var pnew = DenseVector.fill(K)(p)\n       pnew(0) = pnew(0)*3.0        \n       W_poi = constructGraph(K,pnew,r,theta1,theta2,lambda,rho,N1,N2)\n       anomalies1 = DenseVector.rangeD(1, s1_cumsum(0)+1,1)\n       anomalies2 = DenseVector.rangeD(1, s2_cumsum(0)+1,1)     \n      \n    case \"split\" =>\n        var stmp1 = DenseVector.vertcat(constD,s1_temp)\n        var stmp2 = DenseVector.vertcat(constD,s2_temp)\n        val k2 = K+1\n        val temp1 = stmp1(1)*0.5\n        val temp2 = stmp2(1)*0.5\n        stmp1(0)= temp1\n        stmp1(1)= stmp1(1) - temp1\n        stmp2(0)= temp2\n        stmp2(1)= stmp2(1) - temp2\n        val rho_tmp = stmp1 :/ N1.toDouble      \n        anomalies1 = DenseVector.rangeD(1,s1_temp(0)+1.0,1)\n        anomalies2 = DenseVector.rangeD(1,s2_temp(0)+1.0,1)\n        var pnew = DenseVector.fill(k2){p}   \n      \n        for(i <- 1 to pnew.length-1){\n          pnew(i) = pnew(i)*(1.0/(i+1.0))\n        }\n        var rowV = DenseVector.range(1,k2,1)        \n        rowV = DenseVector.vertcat(constI+1,rowV)        \n        var pnew1 = pnew:*rowV.mapValues(_.toDouble)         \n        W_poi = constructGraph(k2,pnew1,r,theta1,theta2,lambda,rho_tmp,N1,N2)\n   \n   case \"shift\" =>\n        var stmp1 = s1_temp\n        val temp1 = stmp1(0)*0.5\n        stmp1(0)  = stmp1(0) - temp1\n        stmp1(1)  = stmp1(1) + temp1\n        var stmp2     = s2_temp\n        val temp2     = stmp2(0)*0.5\n        stmp2(0)  =stmp2(0) - temp2\n        stmp2(1)  =stmp2(1) + temp2\n        var rho_tmp = stmp1:/N1.toDouble\n        var pnew = DenseVector.fill(K){p} \n        anomalies1 = DenseVector.rangeD(stmp1(0),(stmp1(0)+temp1)+1.0)\n        anomalies2 = DenseVector.rangeD(stmp2(0),(stmp2(0)+temp2)+1.0)          \n        W_poi = constructGraph(K,pnew,r,theta1,theta2,lambda,rho_tmp,N1,N2)\n          }\n  val result=graphAnomalyClass(W_poi,anomalies1,anomalies2)\n  result\n}","commandVersion":0,"state":"finished","results":{"type":"html","data":"<div class=\"ansiout\">defined class graphAnomalyClass\ncreateA_anomaly: (K: Int, p: Double, r: Double, theta1: breeze.linalg.DenseVector[Double], theta2: breeze.linalg.DenseVector[Double], lambda: Double, rho: breeze.linalg.DenseVector[Double], changeType: String, graphType: String)graphAnomalyClass\n</div>","arguments":{},"addedWidgets":{},"removedWidgets":[]},"errorSummary":"The spark context has been stopped or the cluster has been terminated. Please restart the cluster or attach this notebook to a different cluster.","error":null,"startTime":1.464839970413E12,"submitTime":1.464839749288E12,"finishTime":1.464839971679E12,"collapsed":false,"bindings":{},"inputWidgets":{},"displayType":"table","width":"auto","height":"auto","xColumns":null,"yColumns":null,"pivotColumns":null,"pivotAggregation":null,"customPlotOptions":{},"commentThread":[],"commentsVisible":false,"parentHierarchy":[],"diffInserts":[],"diffDeletes":[],"globalVars":{},"latestUser":"shakira.suwan@pg.canterbury.ac.nz","commandTitle":"","showCommandTitle":false,"hideCommandCode":false,"hideCommandResult":false,"iPythonMetadata":null,"nuid":"dec97499-8615-4a21-bfc5-ba8c741a6eaf"},{"version":"CommandV1","origId":121846,"guid":"67be5774-8390-4abb-9b2c-98f46283e99f","subtype":"command","commandType":"auto","position":14.0,"command":"def preprocessGraph(adj:DenseMatrix[Double],N1:Int,N2:Int):DenseMatrix[Double]={ \n   val totalUniqueNode=N1.toDouble+N2.toDouble\n   val totalConnection = sum(adj)\n   val avgCon=(2.0*totalConnection.toDouble)/totalUniqueNode\n   \n   val perturbationP = totalConnection / pow(totalUniqueNode,2)\n   var W = adj + perturbationP  // perturbation\n\n   var degree = sum(W(*, ::))\n   var invDeg = pow(degree,-0.5)\n   var invD = diag(invDeg)\n   var normW = invD*W*invD\n  normW\n  \n}","commandVersion":0,"state":"fi
